import  "./AgeInput.css";

const NameInput = () =>{
    return(
        <div className = "age-input">
            <div className="age-label">
               <label>Name </label>
            </div>
            <div className="main-age">
                <input type= "text"/>
            </div>
        </div>
    );
}

export default NameInput;
